import React from 'react';
import {
    Route,
    Router,
    Switch
} from 'react-router-dom';
import Home from './pages/home';

export default ()=>{

    return (
        <Router>
            <Switch>
                <Route path='/' component={Home} />
            </Switch>
        </Router>
    );
}
